import React from "react";
const NavBar =()=>{
    return(
<div className="main-nav-bar">
<ul>
<nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/blogs">Blogs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>

</ul>
</div>
    )
}
export default NavBar;
